import { useState, useEffect, onChange } from "react";


function AddToDo() {
    const [title, setTitle] = useState("") 

    function handleTitleChange(event) {
       newTitle = event.target.value;
    }

    function setNewTitle() {
      setTitle(newTitle)
    }

    return (
    <div>
    <header>
    <h1>To Do List:</h1>
    </header>
    <form id="add-todo-form">
    <label for="add">Title:</label>
    <div id="add-bar">
    <input value={title} onChange={handleTitleChange}  id="bar" name="add" type="text"/>
    <input onClick={setNewTitle} className="submit" type="submit" value="Add"></input>
    </div>
    </form>
     <ul id="to-do-list">
     {/* <li>{title}</li>  */}
     </ul>
    </div>
    )
 }

export default AddToDo;
